function moveAfterpayMessage() {
  var afterpayMessage = document.querySelector('.afterpay-placement');
  var targetDiv = document.querySelector('#afterpay');
  
  if (afterpayMessage && targetDiv) {
    targetDiv.appendChild(afterpayMessage);
