namespace Aquarium
{
    public class AquariumRender
    {
        private char[,] _charMap = new char[15, 51];
        private Random _aquariumRandom;
        private List<Fish> _fishes;

        public AquariumRender(Random aquariumRandom, List<Fish> fishes)
        {
            _aquariumRandom = aquariumRandom;
            _fishes = fishes;
        }

        public void RunMap()
        {
            CreateMap();
            ShowMap();
        }
        
        public void RenderFishesPosition()
        {
            for (int i = 0; i < _fishes.Count; i++)
            {
                Console.SetCursorPosition(_fishes[i].PositionX, _fishes[i].PositionY);
                Console.Write($"{_fishes[i].Type}");
            }
        }
        
        public void ChangeFishesPosition()
        {
            for (int i = 0; i < _fishes.Count; i++)
            {
                int movementDirection = _aquariumRandom.Next(1, 5);
                
                switch (movementDirection)
                {
                    case 1:
                        if (_fishes[i].PositionX > 2)
                        {
                            _fishes[i].PositionX -= 1;
                        }
                        break;
                    case 2:
                        if (_fishes[i].PositionY > 2)
                        {
                            _fishes[i].PositionY -= 1;
                        }
                        break;
                    case 3:
                        if (_fishes[i].PositionX < 48)
                        {
                            _fishes[i].PositionX += 1;
                        }
                        break;
                    case 4:
                        if (_fishes[i].PositionY < 12)
                        {
                            _fishes[i].PositionY += 1;
                        }
                        break;
                    default:
                        continue;
                }
            }
        }

        private void CreateMap()
        {
            Console.CursorVisible = false;
            
            for (int i = 0; i < _charMap.GetLength(0); i++)
            {
                _charMap[i, 0] = '#';
                _charMap[i, 50] = '#';
                
                for (int j = 0; j < _charMap.GetLength(1); j++)
                {
                    _charMap[0, j] = '#';
                    _charMap[14, j] = '#';
                }
            }
        }

        private void ShowMap()
        {
            for (int i = 0; i < _charMap.GetLength(0); i++)
            {
                for (int j = 0; j < _charMap.GetLength(1); j++)
                {
                    Console.Write(_charMap[i, j]);
                }

                Console.WriteLine();
            }
        }
    }
}

using System;
using System.Collections.Generic;

namespace Aquarium
{
    public class Aquarium
    {
        private List<Fish> _fishes;
        private Random _random;
        private AquariumRender _aquarium;

        public Aquarium(Random random, AquariumRender aquariumRender, List<Fish> fishes)
        {
            _random = random;
            _aquarium = aquariumRender;
            _fishes = fishes;
        }

        public void RunAquarium()
        {
            bool isOpen = true;
            
            while (_fishes.Count > 0 && isOpen)
            {
                _aquarium.RunMap();
                _aquarium.RenderFishesPosition();

                Console.SetCursorPosition(0,14);
                ShowAllFishesState();

                Console.WriteLine("\n  : \n" +
                                  "1.     .\n" +
                                  "2.    .\n" +
                                  "3.  1   .\n" +
                                  "4.   .\n");

                Console.CursorVisible = true;
                
                isOpen = InputUserMenu(isOpen);
                
                SetAllFishesOlder();
                RemoveDeadFish();
                _aquarium.ChangeFishesPosition();
                
                Console.Clear();
            }
        }

        private void ShowAllFishesState()
        {
            Console.WriteLine("\n    : ");
            for (int i = 0; i < _fishes.Count; i++)
            {
                Console.Write($"{i} - ");
                _fishes[i].ShowState();
            }
        }

        private void RemoveFish()
        {
            _fishes.RemoveAt(GetFishIndexByName());
        }

        private void AddNewFish()
        {
            Console.WriteLine("  : ");
            char newFishChar = Convert.ToChar(Console.ReadLine());
            Console.WriteLine("  : ");
            string newFishName = Console.ReadLine();
            _fishes.Add(new Fish(newFishChar, _random, newFishName));
        }

        private int GetFishIndexByName()
        {
            Console.WriteLine("       : ");
            string userImput = Console.ReadLine();
            int fishIndex = 99;

            for (int i = 0; i < _fishes.Count; i++)
            {
                if (_fishes[i].Name == userImput)
                {
                    fishIndex = i;
                }
            }

            return fishIndex;
        }

        private void SetAllFishesOlder()
        {
            for (int i = 0; i < _fishes.Count; i++)
            {
                _fishes[i].SetOlder();
            }
        }

        private void RemoveDeadFish()
        {
            for (int i = 0; i < _fishes.Count; i++)
            {
                if (_fishes[i].Age <= 0)
                {
                    _fishes.RemoveAt(i);
                }
            }
        }

        private bool InputUserMenu(bool isOpen)
        {
            string userMenu = Console.ReadLine();

            switch (userMenu)
            {
                case "1":
                    AddNewFish();
                    break;
                case "2":
                    RemoveFish();
                    break;
                case "3":
                    break;
                case "4":
                    isOpen = false;
                    break;
                default:
                    Console.WriteLine("  .  .");
                    break;
            }

            return isOpen;
        }
    }
}

