}

describe('lookupChar', () => {
  it('should return undefined if the first parameter is not a string', () => {
    const result = lookupChar(123, 0);
    assert.equal(result, undefined);
  });

  it('should return undefined if the second parameter is not a number', () => {
    const result = lookupChar('hello', '0');
    assert.equal(result, undefined);
  });

  it('should return undefined if both parameters are of incorrect type', () => {
    const result = lookupChar(123, '0');
    assert.equal(result, undefined);
  });

  it('should return "Incorrect index" if the index is negative', () => {
    const result = lookupChar('hello', -1);
    assert.equal(result, 'Incorrect index');
  });

  it('should return "Incorrect index" if the index is greater than or equal to the string length', () => {
    const result = lookupChar('hello', 5);
    assert.equal(result, 'Incorrect index');
  });

  it('should return the character at the specified index', () => {
    const result = lookupChar('hello', 1);
    assert.equal(result, 'e');
  });
});

